export default  function Empaction(){
    return({
        type:'EmpAction',
    
        payload:[
            {id:1,
            name:'kumar',
            email:'kumar@gmail.com'
           },
        {
            id:2,
            name:'kumar swami ',
            email:'kumar2@gmail.com'
        },
        {id:3,
            name:'kumar3',
            email:'kumar3@gmail.com'
        }
    ]
    })
 }
